The essential data collected by me on phase 1 of the Pfizer vaccine trial, which can be evaluated on the basis of logical-linguistic parameters, can be summarized as follows:
1) FDA, in a document of 11 December 2020 with which it approved the Pfizer vaccine, which bears the pompous title "FDA Takes Key Action in Fight Against COVID-19 By Issuing Emergency Use Authorization for First COVID-19 Vaccine", claims that the efficacy of the vaccine, based on the data provided by the trial, reaches 95%, but in its final evaluations it states verbatim that "At this time, data are not available to make a determination about how long the vaccine will provide protection, nor is there evidence that the vaccine prevents transmission of SARS-CoV-2 from person to person, namely: "
2) AIFA, in the faq n. 31 of its official website, it is not known on the basis of what data other than those provided by the FDA, reduces the percentage of effectiveness to just over 90%, but admits in turn that "a portion of vaccinated people will not develop the immune defense ", And above all that" we still do not know definitively if vaccination only prevents the manifestation of the disease or even the transmission of the infection ".
3) The New England Journal of Medicine, in an article written by the leading scientists, entitled "Safety and Efficacy of the BNT162b2 mRNA Covid-19 Vaccine", states that "few participants in both groups had adverse reactions that led to withdrawal from the trial. No deaths were considered by investigators to be vaccine-related or placebo-related. No deaths associated with Covid-19 were observed. No stopping rules were met during the reporting period. Safety monitoring will continue for 2 years after the administration of the second dose of vaccine "Regardless of the general insignificance of the whole, we still acknowledge that there are no people who died of placebo: it is already something.
In practice, despite the alleged effectiveness between 90% and 95%, for now we are dealing with a vaccine conceived as follows:
a) it is not known "definitively" whether the vaccine prevents the manifestation of the disease.
b) it is not known whether and for how long it provides protection;
c) it is not known whether it can prevent the transmission of the virus from person to person;
d) it is already well known that it will not be able to immunize all vaccinated subjects;

